import { Angle, Length } from '../../../values';
import { OrientationAxis, PositionAxis } from './axis.model';
/**
 * Interface for identifying a TCP
 */
export interface TCPName {
    id: string;
    name: string;
}
/**
 * Type describing a TCP which contains a name along with a position vector and a rotation vector
 */
export type TCP = TCPName & {
    [position in PositionAxis]: Length;
} & {
    [orientation in OrientationAxis]: Angle;
};
